function VideoDesc(props) {
  let desc = props.desc;

  return (
    <section className="video-desc">
      <h1 className="video-desc__title">{desc.title}</h1>
      <h2 className="video-desc__channel">{desc.channel}</h2>
      <h2 className="video-desc__author-date">{desc.timestamp}</h2>
      <img src="" alt="views icon" />
      <h2 className="video-desc__views-number"></h2>
      <img src="" alt="likes icon" />
      <h2 className="video-desc__likes-number"></h2>
      <p className="video-desc__text"></p>
      <h2>3 Comments</h2>
      {/* <Form /> */}
    </section>
  );
}

export default VideoDesc;
